import React, { Component } from 'react';

class SearchTweets extends Component {
	render() {
		return (
			<form className="form-group d-flex my-lg-5 my-sm-1">
				<input className="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" />
				<button className="btn btn-primary mr-1 my-2 my-sm-0" type="submit" style={{ whiteSpace: 'nowrap' }}>
					Search By User
				</button>
				<button className="btn btn-primary my-2 my-sm-0" type="submit" style={{ whiteSpace: 'nowrap' }}>
					Search By Subject
				</button>
			</form>
		);
	}
}

export default SearchTweets;
